component.schema:
{
 "description": "AIPlatformModel is the Schema for the AIPlatformModel API",
 "properties": {
  "spec": {
   "description": "AIPlatformModelSpec defines the desired state of AIPlatformModel",
   "properties": {
    "artifactURI": {
     "description": "Immutable. The path to the directory containing the Model artifact and any of its supporting files. Not required for AutoML Models.",
     "type": "string"
    },
    "baseModelSource": {
     "description": "Optional. User input field to specify the base model source. Currently it only supports specifying the Model Garden models and Genie models.",
     "properties": {
      "genieSource": {
       "description": "Information about the base model of Genie models.",
       "properties": {
        "baseModelURI": {
         "description": "Required. The public base model URI.",
         "type": "string"
        }
       },
       "type": "object"
      },
      "modelGardenSource": {
       "description": "Source information of Model Garden models.",
       "properties": {
        "publicModelName": {
         "description": "Required. The model garden source model resource name.",
         "type": "string"
        }
       },
       "type": "object"
      }
     },
     "type": "object"
    },
    "containerSpec": {
     "description": "Input only. The specification of the container that is to be used when deploying this Model. The specification is ingested upon [ModelService.UploadModel][google.cloud.aiplatform.v1.ModelService.UploadModel], and all binaries it contains are copied and stored internally by Vertex AI. Not required for AutoML Models.",
     "properties": {
      "args": {
       "description": "Immutable. Specifies arguments for the command that runs when the container
 starts. This overrides the container's
 [`CMD`](https://docs.docker.com/engine/reference/builder/#cmd). Specify
 this field as an array of executable and arguments, similar to a Docker
 `CMD`'s "default parameters" form.

 If you don't specify this field but do specify the
 [command][google.cloud.aiplatform.v1.ModelContainerSpec.command] field,
 then the command from the `command` field runs without any additional
 arguments. See the [Kubernetes documentation about how the `command` and
 `args` fields interact with a container's `ENTRYPOINT` and
 `CMD`](https://kubernetes.io/docs/tasks/inject-data-application/define-command-argument-container/#notes).

 If you don't specify this field and don't specify the `command` field,
 then the container's
 [`ENTRYPOINT`](https://docs.docker.com/engine/reference/builder/#cmd) and
 `CMD` determine what runs based on their default behavior. See the Docker
 documentation about [how `CMD` and `ENTRYPOINT`
 interact](https://docs.docker.com/engine/reference/builder/#understand-how-cmd-and-entrypoint-interact).

 In this field, you can reference [environment variables
 set by Vertex
 AI](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#aip-variables)
 and environment variables set in the
 [env][google.cloud.aiplatform.v1.ModelContainerSpec.env] field. You cannot
 reference environment variables set in the Docker image. In order for
 environment variables to be expanded, reference them by using the following
 syntax: <code>$(<var>VARIABLE_NAME</var>)</code> Note that this differs
 from Bash variable expansion, which does not use parentheses. If a variable
 cannot be resolved, the reference in the input string is used unchanged. To
 avoid variable expansion, you can escape this syntax with `$$`; for
 example: <code>$$(<var>VARIABLE_NAME</var>)</code> This field corresponds
 to the `args` field of the Kubernetes Containers [v1 core
 API](https://kubernetes.io/docs/reference/generated/kubernetes-api/v1.23/#container-v1-core).",
       "items": {
        "type": "string"
       },
       "type": "array"
      },
      "command": {
       "description": "Immutable. Specifies the command that runs when the container starts. This
 overrides the container's
 [ENTRYPOINT](https://docs.docker.com/engine/reference/builder/#entrypoint).
 Specify this field as an array of executable and arguments, similar to a
 Docker `ENTRYPOINT`'s "exec" form, not its "shell" form.

 If you do not specify this field, then the container's `ENTRYPOINT` runs,
 in conjunction with the
 [args][google.cloud.aiplatform.v1.ModelContainerSpec.args] field or the
 container's [`CMD`](https://docs.docker.com/engine/reference/builder/#cmd),
 if either exists. If this field is not specified and the container does not
 have an `ENTRYPOINT`, then refer to the Docker documentation about [how
 `CMD` and `ENTRYPOINT`
 interact](https://docs.docker.com/engine/reference/builder/#understand-how-cmd-and-entrypoint-interact).

 If you specify this field, then you can also specify the `args` field to
 provide additional arguments for this command. However, if you specify this
 field, then the container's `CMD` is ignored. See the
 [Kubernetes documentation about how the
 `command` and `args` fields interact with a container's `ENTRYPOINT` and
 `CMD`](https://kubernetes.io/docs/tasks/inject-data-application/define-command-argument-container/#notes).

 In this field, you can reference [environment variables set by Vertex
 AI](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#aip-variables)
 and environment variables set in the
 [env][google.cloud.aiplatform.v1.ModelContainerSpec.env] field. You cannot
 reference environment variables set in the Docker image. In order for
 environment variables to be expanded, reference them by using the following
 syntax: <code>$(<var>VARIABLE_NAME</var>)</code> Note that this differs
 from Bash variable expansion, which does not use parentheses. If a variable
 cannot be resolved, the reference in the input string is used unchanged. To
 avoid variable expansion, you can escape this syntax with `$$`; for
 example: <code>$$(<var>VARIABLE_NAME</var>)</code> This field corresponds
 to the `command` field of the Kubernetes Containers [v1 core
 API](https://kubernetes.io/docs/reference/generated/kubernetes-api/v1.23/#container-v1-core).",
       "items": {
        "type": "string"
       },
       "type": "array"
      },
      "deploymentTimeout": {
       "description": "Immutable. Deployment timeout. Limit for deployment timeout is 2 hours.",
       "type": "string"
      },
      "env": {
       "description": "Immutable. List of environment variables to set in the container. After the
 container starts running, code running in the container can read these
 environment variables.

 Additionally, the
 [command][google.cloud.aiplatform.v1.ModelContainerSpec.command] and
 [args][google.cloud.aiplatform.v1.ModelContainerSpec.args] fields can
 reference these variables. Later entries in this list can also reference
 earlier entries. For example, the following example sets the variable
 `VAR_2` to have the value `foo bar`:

 ```json
 [
   {
     "name": "VAR_1",
     "value": "foo"
   },
   {
     "name": "VAR_2",
     "value": "$(VAR_1) bar"
   }
 ]
 ```

 If you switch the order of the variables in the example, then the expansion
 does not occur.

 This field corresponds to the `env` field of the Kubernetes Containers
 [v1 core
 API](https://kubernetes.io/docs/reference/generated/kubernetes-api/v1.23/#container-v1-core).",
       "items": {
        "properties": {
         "name": {
          "description": "Required. Name of the environment variable. Must be a valid C identifier.",
          "type": "string"
         },
         "value": {
          "description": "Required. Variables that reference a $(VAR_NAME) are expanded using the previous defined environment variables in the container and any service environment variables. If a variable cannot be resolved, the reference in the input string will be unchanged. The $(VAR_NAME) syntax can be escaped with a double $$, ie: $$(VAR_NAME). Escaped references will never be expanded, regardless of whether the variable exists or not.",
          "type": "string"
         }
        },
        "type": "object"
       },
       "type": "array"
      },
      "grpcPorts": {
       "description": "Immutable. List of ports to expose from the container. Vertex AI sends gRPC
 prediction requests that it receives to the first port on this list. Vertex
 AI also sends liveness and health checks to this port.

 If you do not specify this field, gRPC requests to the container will be
 disabled.

 Vertex AI does not use ports other than the first one listed. This field
 corresponds to the `ports` field of the Kubernetes Containers v1 core API.",
       "items": {
        "properties": {
         "containerPort": {
          "description": "The number of the port to expose on the pod's IP address. Must be a valid port number, between 1 and 65535 inclusive.",
          "format": "int32",
          "type": "integer"
         }
        },
        "type": "object"
       },
       "type": "array"
      },
      "healthProbe": {
       "description": "Immutable. Specification for Kubernetes readiness probe.",
       "properties": {
        "exec": {
         "description": "ExecAction probes the health of a container by executing a command.",
         "properties": {
          "command": {
           "description": "Command is the command line to execute inside the container, the working directory for the command is root ('/') in the container's filesystem. The command is simply exec'd, it is not run inside a shell, so traditional shell instructions ('|', etc) won't work. To use a shell, you need to explicitly call out to that shell. Exit status of 0 is treated as live/healthy and non-zero is unhealthy.",
           "items": {
            "type": "string"
           },
           "type": "array"
          }
         },
         "type": "object"
        },
        "periodSeconds": {
         "description": "How often (in seconds) to perform the probe. Default to 10 seconds.
 Minimum value is 1. Must be less than timeout_seconds.

 Maps to Kubernetes probe argument 'periodSeconds'.",
         "format": "int32",
         "type": "integer"
        },
        "timeoutSeconds": {
         "description": "Number of seconds after which the probe times out. Defaults to 1 second.
 Minimum value is 1. Must be greater or equal to period_seconds.

 Maps to Kubernetes probe argument 'timeoutSeconds'.",
         "format": "int32",
         "type": "integer"
        }
       },
       "type": "object"
      },
      "healthRoute": {
       "description": "Immutable. HTTP path on the container to send health checks to. Vertex AI
 intermittently sends GET requests to this path on the container's IP
 address and port to check that the container is healthy. Read more about
 [health
 checks](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#health).

 For example, if you set this field to `/bar`, then Vertex AI
 intermittently sends a GET request to the `/bar` path on the port of your
 container specified by the first value of this `ModelContainerSpec`'s
 [ports][google.cloud.aiplatform.v1.ModelContainerSpec.ports] field.

 If you don't specify this field, it defaults to the following value when
 you [deploy this Model to an
 Endpoint][google.cloud.aiplatform.v1.EndpointService.DeployModel]:
 <code>/v1/endpoints/<var>ENDPOINT</var>/deployedModels/<var>DEPLOYED_MODEL</var>:predict</code>
 The placeholders in this value are replaced as follows:

 * <var>ENDPOINT</var>: The last segment (following `endpoints/`)of the
   Endpoint.name][] field of the Endpoint where this Model has been
   deployed. (Vertex AI makes this value available to your container code
   as the [`AIP_ENDPOINT_ID` environment
   variable](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#aip-variables).)

 * <var>DEPLOYED_MODEL</var>:
 [DeployedModel.id][google.cloud.aiplatform.v1.DeployedModel.id] of the
 `DeployedModel`.
   (Vertex AI makes this value available to your container code as the
   [`AIP_DEPLOYED_MODEL_ID` environment
   variable](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#aip-variables).)",
       "type": "string"
      },
      "imageURI": {
       "description": "Required. Immutable. URI of the Docker image to be used as the custom
 container for serving predictions. This URI must identify an image in
 Artifact Registry or Container Registry. Learn more about the [container
 publishing
 requirements](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#publishing),
 including permissions requirements for the Vertex AI Service Agent.

 The container image is ingested upon
 [ModelService.UploadModel][google.cloud.aiplatform.v1.ModelService.UploadModel],
 stored internally, and this original path is afterwards not used.

 To learn about the requirements for the Docker image itself, see
 [Custom container
 requirements](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#).

 You can use the URI to one of Vertex AI's [pre-built container images for
 prediction](https://cloud.google.com/vertex-ai/docs/predictions/pre-built-containers)
 in this field.",
       "type": "string"
      },
      "ports": {
       "description": "Immutable. List of ports to expose from the container. Vertex AI sends any
 prediction requests that it receives to the first port on this list. Vertex
 AI also sends
 [liveness and health
 checks](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#liveness)
 to this port.

 If you do not specify this field, it defaults to following value:

 ```json
 [
   {
     "containerPort": 8080
   }
 ]
 ```

 Vertex AI does not use ports other than the first one listed. This field
 corresponds to the `ports` field of the Kubernetes Containers
 [v1 core
 API](https://kubernetes.io/docs/reference/generated/kubernetes-api/v1.23/#container-v1-core).",
       "items": {
        "properties": {
         "containerPort": {
          "description": "The number of the port to expose on the pod's IP address. Must be a valid port number, between 1 and 65535 inclusive.",
          "format": "int32",
          "type": "integer"
         }
        },
        "type": "object"
       },
       "type": "array"
      },
      "predictRoute": {
       "description": "Immutable. HTTP path on the container to send prediction requests to.
 Vertex AI forwards requests sent using
 [projects.locations.endpoints.predict][google.cloud.aiplatform.v1.PredictionService.Predict]
 to this path on the container's IP address and port. Vertex AI then returns
 the container's response in the API response.

 For example, if you set this field to `/foo`, then when Vertex AI
 receives a prediction request, it forwards the request body in a POST
 request to the `/foo` path on the port of your container specified by the
 first value of this `ModelContainerSpec`'s
 [ports][google.cloud.aiplatform.v1.ModelContainerSpec.ports] field.

 If you don't specify this field, it defaults to the following value when
 you [deploy this Model to an
 Endpoint][google.cloud.aiplatform.v1.EndpointService.DeployModel]:
 <code>/v1/endpoints/<var>ENDPOINT</var>/deployedModels/<var>DEPLOYED_MODEL</var>:predict</code>
 The placeholders in this value are replaced as follows:

 * <var>ENDPOINT</var>: The last segment (following `endpoints/`)of the
   Endpoint.name][] field of the Endpoint where this Model has been
   deployed. (Vertex AI makes this value available to your container code
   as the [`AIP_ENDPOINT_ID` environment
  variable](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#aip-variables).)

 * <var>DEPLOYED_MODEL</var>:
 [DeployedModel.id][google.cloud.aiplatform.v1.DeployedModel.id] of the
 `DeployedModel`.
   (Vertex AI makes this value available to your container code
   as the [`AIP_DEPLOYED_MODEL_ID` environment
   variable](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#aip-variables).)",
       "type": "string"
      },
      "sharedMemorySizeMb": {
       "description": "Immutable. The amount of the VM memory to reserve as the shared memory for the model in megabytes.",
       "format": "int64",
       "type": "integer"
      },
      "startupProbe": {
       "description": "Immutable. Specification for Kubernetes startup probe.",
       "properties": {
        "exec": {
         "description": "ExecAction probes the health of a container by executing a command.",
         "properties": {
          "command": {
           "description": "Command is the command line to execute inside the container, the working directory for the command is root ('/') in the container's filesystem. The command is simply exec'd, it is not run inside a shell, so traditional shell instructions ('|', etc) won't work. To use a shell, you need to explicitly call out to that shell. Exit status of 0 is treated as live/healthy and non-zero is unhealthy.",
           "items": {
            "type": "string"
           },
           "type": "array"
          }
         },
         "type": "object"
        },
        "periodSeconds": {
         "description": "How often (in seconds) to perform the probe. Default to 10 seconds.
 Minimum value is 1. Must be less than timeout_seconds.

 Maps to Kubernetes probe argument 'periodSeconds'.",
         "format": "int32",
         "type": "integer"
        },
        "timeoutSeconds": {
         "description": "Number of seconds after which the probe times out. Defaults to 1 second.
 Minimum value is 1. Must be greater or equal to period_seconds.

 Maps to Kubernetes probe argument 'timeoutSeconds'.",
         "format": "int32",
         "type": "integer"
        }
       },
       "type": "object"
      }
     },
     "type": "object"
    },
    "dataStats": {
     "description": "Stats of data used for training or evaluating the Model.

 Only populated when the Model is trained by a TrainingPipeline with
 [data_input_config][google.cloud.aiplatform.v1.TrainingPipeline.input_data_config].",
     "properties": {
      "testAnnotationsCount": {
       "description": "Number of Annotations that are used for evaluating this Model. If the Model is evaluated multiple times, this will be the number of test Annotations used by the first evaluation. If the Model is not evaluated, the number is 0.",
       "format": "int64",
       "type": "integer"
      },
      "testDataItemsCount": {
       "description": "Number of DataItems that were used for evaluating this Model. If the Model is evaluated multiple times, this will be the number of test DataItems used by the first evaluation. If the Model is not evaluated, the number is 0.",
       "format": "int64",
       "type": "integer"
      },
      "trainingAnnotationsCount": {
       "description": "Number of Annotations that are used for training this Model.",
       "format": "int64",
       "type": "integer"
      },
      "trainingDataItemsCount": {
       "description": "Number of DataItems that were used for training this Model.",
       "format": "int64",
       "type": "integer"
      },
      "validationAnnotationsCount": {
       "description": "Number of Annotations that are used for validating this Model during training.",
       "format": "int64",
       "type": "integer"
      },
      "validationDataItemsCount": {
       "description": "Number of DataItems that were used for validating this Model during training.",
       "format": "int64",
       "type": "integer"
      }
     },
     "type": "object"
    },
    "description": {
     "description": "The description of the Model.",
     "type": "string"
    },
    "displayName": {
     "description": "Required. The display name of the Model. The name can be up to 128 characters long and can consist of any UTF-8 characters.",
     "type": "string"
    },
    "encryptionSpec": {
     "description": "Customer-managed encryption key spec for a Model. If set, this Model and all sub-resources of this Model will be secured by this key.",
     "properties": {
      "kmsKeyName": {
       "description": "Required. The Cloud KMS resource identifier of the customer managed encryption key used to protect a resource. Has the form: `projects/my-project/locations/my-region/keyRings/my-kr/cryptoKeys/my-key`. The key needs to be in the same region as where the compute resource is created.",
       "type": "string"
      }
     },
     "type": "object"
    },
    "etag": {
     "description": "Used to perform consistent read-modify-write updates. If not set, a blind "overwrite" update happens.",
     "type": "string"
    },
    "explanationSpec": {
     "description": "The default explanation specification for this Model.

 The Model can be used for
 [requesting
 explanation][google.cloud.aiplatform.v1.PredictionService.Explain] after
 being [deployed][google.cloud.aiplatform.v1.EndpointService.DeployModel] if
 it is populated. The Model can be used for [batch
 explanation][google.cloud.aiplatform.v1.BatchPredictionJob.generate_explanation]
 if it is populated.

 All fields of the explanation_spec can be overridden by
 [explanation_spec][google.cloud.aiplatform.v1.DeployedModel.explanation_spec]
 of
 [DeployModelRequest.deployed_model][google.cloud.aiplatform.v1.DeployModelRequest.deployed_model],
 or
 [explanation_spec][google.cloud.aiplatform.v1.BatchPredictionJob.explanation_spec]
 of [BatchPredictionJob][google.cloud.aiplatform.v1.BatchPredictionJob].

 If the default explanation specification is not set for this Model, this
 Model can still be used for
 [requesting
 explanation][google.cloud.aiplatform.v1.PredictionService.Explain] by
 setting
 [explanation_spec][google.cloud.aiplatform.v1.DeployedModel.explanation_spec]
 of
 [DeployModelRequest.deployed_model][google.cloud.aiplatform.v1.DeployModelRequest.deployed_model]
 and for [batch
 explanation][google.cloud.aiplatform.v1.BatchPredictionJob.generate_explanation]
 by setting
 [explanation_spec][google.cloud.aiplatform.v1.BatchPredictionJob.explanation_spec]
 of [BatchPredictionJob][google.cloud.aiplatform.v1.BatchPredictionJob].",
     "properties": {
      "metadata": {
       "description": "Optional. Metadata describing the Model's input and output for explanation.",
       "properties": {
        "featureAttributionsSchemaURI": {
         "description": "Points to a YAML file stored on Google Cloud Storage describing the format of the [feature attributions][google.cloud.aiplatform.v1.Attribution.feature_attributions]. The schema is defined as an OpenAPI 3.0.2 [Schema Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.0.2.md#schemaObject). AutoML tabular Models always have this field populated by Vertex AI. Note: The URI given on output may be different, including the URI scheme, than the one given on input. The output URI will point to a location where the user only has a read access.",
         "type": "string"
        },
        "inputs": {
         "additionalProperties": {
          "properties": {
           "denseShapeTensorName": {
            "description": "Specifies the shape of the values of the input if the input is a sparse representation. Refer to Tensorflow documentation for more details: https://www.tensorflow.org/api_docs/python/tf/sparse/SparseTensor.",
            "type": "string"
           },
           "encodedBaselines": {
            "description": "A list of baselines for the encoded tensor.

 The shape of each baseline should match the shape of the encoded tensor.
 If a scalar is provided, Vertex AI broadcasts to the same shape as the
 encoded tensor.",
            "items": {
             "properties": {
              "boolValue": {
               "description": "Represents a boolean value.",
               "type": "boolean"
              },
              "nullValue": {
               "description": "Represents a null value.",
               "type": "string"
              },
              "numberValue": {
               "description": "Represents a double value.",
               "type": "number"
              },
              "stringValue": {
               "description": "Represents a string value.",
               "type": "string"
              },
              "structValue": {
               "additionalProperties": {
                "type": "string"
               },
               "description": "Represents a structured value.",
               "type": "object"
              }
             },
             "type": "object"
            },
            "type": "array"
           },
           "encodedTensorName": {
            "description": "Encoded tensor is a transformation of the input tensor. Must be provided
 if choosing
 [Integrated Gradients
 attribution][google.cloud.aiplatform.v1.ExplanationParameters.integrated_gradients_attribution]
 or [XRAI
 attribution][google.cloud.aiplatform.v1.ExplanationParameters.xrai_attribution]
 and the input tensor is not differentiable.

 An encoded tensor is generated if the input tensor is encoded by a lookup
 table.",
            "type": "string"
           },
           "encoding": {
            "description": "Defines how the feature is encoded into the input tensor. Defaults to IDENTITY.",
            "type": "string"
           },
           "featureValueDomain": {
            "description": "The domain details of the input feature value. Like min/max, original mean or standard deviation if normalized.",
            "properties": {
             "maxValue": {
              "description": "The maximum permissible value for this feature.",
              "type": "number"
             },
             "minValue": {
              "description": "The minimum permissible value for this feature.",
              "type": "number"
             },
             "originalMean": {
              "description": "If this input feature has been normalized to a mean value of 0, the original_mean specifies the mean value of the domain prior to normalization.",
              "type": "number"
             },
             "originalStddev": {
              "description": "If this input feature has been normalized to a standard deviation of 1.0, the original_stddev specifies the standard deviation of the domain prior to normalization.",
              "type": "number"
             }
            },
            "type": "object"
           },
           "groupName": {
            "description": "Name of the group that the input belongs to. Features with the same group name will be treated as one feature when computing attributions. Features grouped together can have different shapes in value. If provided, there will be one single attribution generated in [Attribution.feature_attributions][google.cloud.aiplatform.v1.Attribution.feature_attributions], keyed by the group name.",
            "type": "string"
           },
           "indexFeatureMapping": {
            "description": "A list of feature names for each index in the input tensor. Required when the input [InputMetadata.encoding][google.cloud.aiplatform.v1.ExplanationMetadata.InputMetadata.encoding] is BAG_OF_FEATURES, BAG_OF_FEATURES_SPARSE, INDICATOR.",
            "items": {
             "type": "string"
            },
            "type": "array"
           },
           "indicesTensorName": {
            "description": "Specifies the index of the values of the input tensor. Required when the input tensor is a sparse representation. Refer to Tensorflow documentation for more details: https://www.tensorflow.org/api_docs/python/tf/sparse/SparseTensor.",
            "type": "string"
           },
           "inputBaselines": {
            "description": "Baseline inputs for this feature.

 If no baseline is specified, Vertex AI chooses the baseline for this
 feature. If multiple baselines are specified, Vertex AI returns the
 average attributions across them in
 [Attribution.feature_attributions][google.cloud.aiplatform.v1.Attribution.feature_attributions].

 For Vertex AI-provided Tensorflow images (both 1.x and 2.x), the shape
 of each baseline must match the shape of the input tensor. If a scalar is
 provided, we broadcast to the same shape as the input tensor.

 For custom images, the element of the baselines must be in the same
 format as the feature's input in the
 [instance][google.cloud.aiplatform.v1.ExplainRequest.instances][]. The
 schema of any single instance may be specified via Endpoint's
 DeployedModels' [Model's][google.cloud.aiplatform.v1.DeployedModel.model]
 [PredictSchemata's][google.cloud.aiplatform.v1.Model.predict_schemata]
 [instance_schema_uri][google.cloud.aiplatform.v1.PredictSchemata.instance_schema_uri].",
            "items": {
             "properties": {
              "boolValue": {
               "description": "Represents a boolean value.",
               "type": "boolean"
              },
              "nullValue": {
               "description": "Represents a null value.",
               "type": "string"
              },
              "numberValue": {
               "description": "Represents a double value.",
               "type": "number"
              },
              "stringValue": {
               "description": "Represents a string value.",
               "type": "string"
              },
              "structValue": {
               "additionalProperties": {
                "type": "string"
               },
               "description": "Represents a structured value.",
               "type": "object"
              }
             },
             "type": "object"
